商品区分:中古ノートパソコン<br>
メーカ：NEC<br>
機種名・型番:LaVie L　LL750/JS1YR　PC-LL750JS1YR<br>
OS：Windows8 64bit<br>
CPU：Corei7 3630QM-2.4GHz<br>
